import React from 'react';
import NavMenu from './NavMenu';
import '../Styles/General.css';
import '../Styles/Visit.css'; 

function Visit(){
  return (
    <div className="visit-container">
      <h1 className="visit-title">VISIT</h1>
      <p>Welcome to our museum! Here, you can explore a variety of exhibits showcasing the art of photography. Take your time to appreciate the captivating images and immerse yourself in the world of visual storytelling.</p>
      <p>Plan your visit and make the most of your experience by checking out our upcoming events and exhibitions. We look forward to seeing you!</p>
      <NavMenu />
    </div>
  );
};

export default Visit;
